@userland
def evaluate(
    location: PYU,
    true: VDataFrame,
    predictions: SPUObject,
):
    y_score = predictions.to(location)
    y_true = true.get_flat_column("y")
    y_true = y_true.to(location)

    def validate(y_true, y_score):
        return roc_auc_score(y_true.reshape(-1), y_score.reshape(-1))

    return reveal(location(validate)(y_true, y_score))

